MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "CalibrenmSRAF uses a template-defined method to insert sub-resolution assist features into a design. Calibre nmSRAF includes dimension- and model-based SRAF generation tools. Sub-Resolution Assist Features (SRAFs) are slivers of chrome strategically placed on the mask to sharpen printable images. The generated SRAFs remain too small to print.");
MGCAddSnippet(5, "The Calibre nmSRAF workflow enables successful generation of SRAFs.");
MGCAddSnippet(6, "Calibre nmSRAF uses dimensional templates that are defined through specification of spacing, width and length parameters, among others.");
MGCAddSnippet(7, "Calibre nmSRAF requires executable paths, licenses and variables to be set prior to running the tools.");
MGCAddSnippet(8, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(9, "Calibre nmSRAF uses dimension-based and model-based methodologies for cnsraf and mbsraf, respectively. ");
MGCAddSnippet(10, "A template is a specified arrangement of SRAFs around a contact feature based upon a pitch or distance from edges and corners. ");
MGCAddSnippet(11, "Conflict regions are processed by cnsraf to ensure adherence to MRC requirements and to enable resolution of SRAFs within conflict regions.");
MGCAddSnippet(12, "Calibre OPCsbar and Calibre cnSRAF can be used together. You can use output from Calibre OPCsbar as input to Calibre cnSRAF or conversely, Calibre cnSRAF as input to Calibre OPCsbar.");
MGCAddSnippet(13, "Careful planning of the Calibre nmSRAF command flow ensures quality SRAF placement.");
MGCAddSnippet(14, "Specific tools and data are required for successful nmSRAF generation.");
MGCAddSnippet(15, "The type of layout dictates the optimal Calibre nmSRAF template. ");
MGCAddSnippet(16, "Calibre nmSRAF relies on proper ordering of templates within SRAF generation recipes. ");
MGCAddSnippet(17, "The Calibre pxOPC SRAF results can facilitate the generation of Calibre nmSRAF templates. In simple cases, this is accomplished by matching Calibre pxOPC SRAFs with Calibre nmSRAF templates.");
MGCAddSnippet(18, "You define Calibre nmSRAF dimensional- or model-based templates to insert sub-resolution assist features (SRAFs) into the layout to achieve the best process window.");
MGCAddSnippet(19, "Calibre nmSRAF commands adhere to SVRF standards. A typical SVRF rule file containing cnsraf-related commands may also contain other SVRF commands that specify input layers, perform preliminary layer manipulation, and save output layers.");
MGCAddSnippet(20, "Invokes Calibre mbSRAF.");
MGCAddSnippet(21, "Invokes Calibre cnSRAF.");
MGCAddSnippet(22, "You write commands within the LITHO FILE statement to control setlayer cnsraf and setlayer mbsraf.");
MGCAddSnippet(23, "Specifies Calibre nmSRAF commands within the SVRF rule file. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(24, "Defines background imaging characteristics. Used by RET MBSRAF only.");
MGCAddSnippet(25, "Copies cells with nonzero transforms so that simulation of asymmetric optical models is correct. Used by RET MBSRAF only.");
MGCAddSnippet(26, "Specifies the DDM model name. Used by RET MBSRAF only.");
MGCAddSnippet(27, "Loads DDM models. Used by RET MBSRAF only.");
MGCAddSnippet(28, "Associates a precomputed long range flare convolution with a flare model contained inside a litho model. Used by RET EUV MBSRAF only.");
MGCAddSnippet(29, "A LITHO FILE command referencing the Lithomodel file and an sraf_options command referencing the litho_model name. Used by RET MBSRAF only.");
MGCAddSnippet(30, "An input layer called by setlayer for generating SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(31, "Specifies the directory name that contains files for the litho model format. Used by RET MBSRAF only.");
MGCAddSnippet(32, "Specifies the directories to search for optical and resist models. Used by RET MBSRAF only.");
MGCAddSnippet(33, "Specifies the optical model name. Used by RET MBSRAF only.");
MGCAddSnippet(34, "Specifies an optical model. Alternate to litho model format. Used by RET MBSRAF only.");
MGCAddSnippet(35, "Specifies the depth of the z-axis within the resist film where the image is computed. Used by RET MBSRAF only.");
MGCAddSnippet(36, "Enables various processing modes. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(37, "Estimates the progress of the LITHO operation. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(38, "Specifies the resist model name or aerial threshold value. Used by RET MBSRAF only.");
MGCAddSnippet(39, "Specifies a resist model. Alternate to litho model format. Used by RET MBSRAF only.");
MGCAddSnippet(40, "Generates SRAFs using dimensional templates. Used by RET SBAR only.");
MGCAddSnippet(41, "Generates and saves in-process debugging layers. Used by RET SBAR only.");
MGCAddSnippet(42, "Generates SRAFs using a model-based methodology. Used by RET MBSRAF only.");
MGCAddSnippet(43, "Generates and saves in-process debugging layers. Used by RET MBSRAF only.");
MGCAddSnippet(44, "Creates a layer to display tile and cell boundaries. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(45, "Allows Calibre nmSRAF keywords to be written in free format. The sraf_options statement is called by the setlayer command for SRAF generation. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(46, "Imports variables from the SVRF into the LITHO FILE command. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(47, "Specifies the size of a processing tile. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(48, "You write statements within the LITHO FILE block to control RET EUV MBSRAF commands.");
MGCAddSnippet(49, "Specify keywords within the sraf_options statement to control setlayer cnsraf and setlayer mbsraf commands.");
MGCAddSnippet(50, "Calibre nmSRAF requires input layers for SRAF generation.");
MGCAddSnippet(51, "Specifies a polygon layer for gradient calculation. Used by MBSRAF only.");
MGCAddSnippet(52, "Specifies a layer name representing areas within which to prohibit positive and negative SRAF generation. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(53, "Specifies shapes or edges prioritized as targets during SRAF generation. Used by RET MBSRAF only.");
MGCAddSnippet(54, "Specifies a layer name containing preexisting SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(55, "Specifies a tag name representing imported layers or edges from SVRF. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(56, "Tags direct templates where to generate SRAFs. The newtag family of keywords select edges and refine locations of SRAF placement.");
MGCAddSnippet(57, "Specifies a tag name representing boolean combinations of layers or edges. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(58, "Specifies a tag name representing the inner or outer edges of layers for which to generate SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(59, "Specifies a tag name representing all target edges interacting with the specified tag layer. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(60, "Specifies a tag name representing all target edges qualified by the length specified. Used for RET SBAR and RET MBSRAF.");
MGCAddSnippet(61, "Specifies a tag name representing orientations for edges, corners and angles. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(62, "Specifies a tag name, exclusively for pairtemplate, that represents layers or edges for which to generate SRAFs. Used by RET SBAR only.");
MGCAddSnippet(63, "Specifies a tag name representing all edges of rectangular target shapes matching the specified constraint. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(64, "Specifies a tag name representing the edges of square target shapes matching the constraint. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(65, "Calibre nmSRAF requires the specification of some minimum SRAF dimensions for application of MRC rules.");
MGCAddSnippet(66, "Interprets canonical cell and tile origins in alignment with global database origins. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(67, "Specifies SRAF extension length. Used by RET MBSRAF only.");
MGCAddSnippet(68, "Specifies the maximum length of generated SRAFs, and the combined maximum length of generated SRAFs of same priorities during cleanup. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(69, "Specifies the maximum distance from an SRAF to a target shape. Used by RET MBSRAF only.");
MGCAddSnippet(70, "Specifies the maximum distance from a negative SRAF to the enclosing target shape edge. Used by RET MBSRAF only.");
MGCAddSnippet(71, "Specifies the minimum area for SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(72, "Specifies the minimum area for 45-degree SRAF extensions. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(73, "Specifies the minimum distance from target shapes to an SRAF. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(74, "Specifies the minimum length allowed for a rectangular SRAF. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(75, "Specifies the minimum length for 45-degree SRAF extensions. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(76, "Specifies the minimum distances between generated SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(77, "Specifies the minimum distance to SRAF shapes from the offsetlayer. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(78, "Specifies the minimum area of a square SRAF. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(79, "Specifies the minimum edge length for square SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(80, "Specifies the minimum width allowed for square SRAFs. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(81, "Uses edge tag shielding to characterize SRAF generation. Used by RET MBSRAF only.");
MGCAddSnippet(82, "Specifies the width of square SRAFs. Used by RET MBSRAF only.");
MGCAddSnippet(83, "Specifies the default width of generated SRAFs. Used by RET MBSRAF only.");
MGCAddSnippet(84, "Calibre nmSRAF requires dimensional- or model-based templates to pattern and prioritize SRAF generation.");
MGCAddSnippet(85, "Creates SRAFs around the local maxima of the gradient. Used by RET MBSRAF only.");
MGCAddSnippet(86, "Places SRAFs at specified angles and offsets from target shape center. Used by RET SBAR only.");
MGCAddSnippet(87, "Places a rectangular SRAF relative to the center of the target shape. Used by RET SBAR only.");
MGCAddSnippet(88, "Places four rectangular SRAFs rotated 45 degrees relative to the target shape center. Used by RET SBAR only.");
MGCAddSnippet(89, "Places four rectangular SRAFs rotated 45 degrees at target shape corners. Used by RET SBAR only.");
MGCAddSnippet(90, "Places SRAFs with four methods relative to corners of target shapes. Used by RET SBAR only.");
MGCAddSnippet(91, "Places four or eight rectangular SRAFs diagonally offset relative to the center of the target shape. Used by RET SBAR only.");
MGCAddSnippet(92, "Places rectangular SRAFs offset from each edge of the target shape. Used by RET SBAR only.");
MGCAddSnippet(93, "Places four rectangular SRAFs at orthogonal X,Y pitches relative to the target shape center. Used by RET SBAR only.");
MGCAddSnippet(94, "Places square SRAFs radially around a target shape. Used by RET SBAR only.");
MGCAddSnippet(95, "Places rectangular and square SRAFs radially around a target shape. Used by RET SBAR only.");
MGCAddSnippet(96, "Provides management of SRAF output style.");
MGCAddSnippet(97, "Modifies geometric consistency of generated SRAF candidates. Used by RET MBSRAF only.");
MGCAddSnippet(98, "Disables slit interpolation. Used by RET EUV MBSRAF only.");
MGCAddSnippet(99, "Enables the generation of SRAFs equidistant from target edges. Used by RET MBSRAF.");
MGCAddSnippet(100, "Collects seed pixels near target corners to generate square SRAFs. Used by RET MBSRAF only.");
MGCAddSnippet(101, "Specifies the SRAF generation method at target shape corners. Used by RET MBSRAF only.");
MGCAddSnippet(102, "Specifies the negative SRAF generation method at target shape corners. Used by RET MBSRAF only.");
MGCAddSnippet(103, "Specifies a gradient factor value for negative SRAFs. Used by RET MBSRAF only.");
MGCAddSnippet(104, "Specifies a gradient shift value. Used by RET MBSRAF only.");
MGCAddSnippet(105, "A LITHO FILE command referencing the Lithomodel file and an sraf_options command referencing the litho_model name. Used by RET MBSRAF only.");
MGCAddSnippet(106, "Enables valid SRAFs to be merged at various junctions. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(107, "Enables valid negative SRAFs to be merged at various junctions. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(108, "Overrides jogs in generated SRAFs. Used by RET MBSRAF only.");
MGCAddSnippet(109, "Specifies a generated SRAF orientation. Used by RET MBSRAF only.");
MGCAddSnippet(110, "Enables negative SRAF output. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(111, "Specifies the method of SRAF propagation. Used by RET MBSRAF only.");
MGCAddSnippet(112, "Specifies a process window condition. Used by RET MBSRAF only.");
MGCAddSnippet(113, "Specifies the gradient slope weight. Used by RET MBSRAF only.");
MGCAddSnippet(114, "Ensures all templates generate SRAFs with symmetry. Used by RET SBAR only.");
MGCAddSnippet(115, "Provides commands for managing conflicts formed during SRAF generation.");
MGCAddSnippet(116, "Specifies the threshold of a conflict region. Used by RET SBAR only.");
MGCAddSnippet(117, "Specifies the means of conflict region processing. Used by RET SBAR only.");
MGCAddSnippet(118, "Specifies the maximum size of a conflict region. Used by RET SBAR only.");
MGCAddSnippet(119, "Allows SRAFs within conflict regions to exceed the conflict region size. Used by RET SBAR only.");
MGCAddSnippet(120, "Specifies the width of secondary SRAFs. Used by RET SBAR only.");
MGCAddSnippet(121, "Enables and specifies the size of SRAF output in conflict regions. Used by RET SBAR only.");
MGCAddSnippet(122, "Calibre nmSRAF invokes SRAF cleanup after generation.");
MGCAddSnippet(123, "Merges two parallel SRAFs within the specified distance. Used by RET SBAR only.");
MGCAddSnippet(124, "Specifies the method of SRAF removal. Used by RET SBAR only.");
MGCAddSnippet(125, "Specifies the version of SRAF cleanup. Used by RET SBAR only.");
MGCAddSnippet(126, "Disables default promotion for cnsraf. Used by RET SBAR only.");
MGCAddSnippet(127, "Sizes SRAFs during generation. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(128, "Manages the sizing of SRAFs near tile boundaries during generation. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(129, "Disables centermerge emphasis on long SRAFs. Used by RET SBAR only.");
MGCAddSnippet(130, "Aligns SRAFs of different priorities during cleanup. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(131, "Aligns SRAFs of same priorities during cleanup. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(132, "Merges SRAF line-ends during SRAF cleanup. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(133, "Restricts SRAF movement during cleanup. Used by RET MBSRAF only.");
MGCAddSnippet(134, "Splits or merges SRAFs in conflict. Used by RET SBAR only.");
MGCAddSnippet(135, "Calibre nmSRAF provides many keywords to be called by priority.");
MGCAddSnippet(136, "Overrides global parameters by priority as specified by each template. Used by RET SBAR and RET MBSRAF.");
MGCAddSnippet(137, "Siemens EDA provides several tools for SRAF insertion, each taking different approaches and working together to provide optimized results.");
MGCAddSnippet(138, "When developing recipes, Siemens EDA recommends you start from isolated layout features and transition to layouts with greater feature density.");
MGCAddSnippet(139, "Application of best practices aid in recipe development.");
MGCAddSnippet(140, "Careful setup during cnsraf template development insures optimal SRAF generation and best image fidelity.");
MGCAddSnippet(141, "Recommended settings improve results produced by the cnsraf command.");
MGCAddSnippet(142, "Recommended settings improve the results produced by the mbsraf command.");
MGCAddSnippet(143, "Understanding informational messages and correcting warning messages aid in improving results generated by Calibre nmSRAF.");
MGCAddSnippet(144, "Optimal placement of SRAFs require an iterative cleanup process during generation.");
MGCAddSnippet(145, "Calibre nmSRAF uses multiple steps to clean generated SRAFs for their optimal placement.");
MGCAddSnippet(146, "Calibre nmSRAF runs in batch mode, and requires an SVRF file. This input file is processed by the Calibre nmDRC-H hierarchical database engine.");
MGCAddSnippet(147, "Executes SVRF commands.");
MGCAddSnippet(148, "The RET Flow Tool provided in Calibre WORKbench provides a GUI interface for generating and running application setup files. ");
MGCAddSnippet(149, "The RET Flow Tool is a productive GUI-based tool used with Calibre nmSRAF.");
MGCAddSnippet(150, "The RET Flow Tool provides a convenient, productive method for executing a number of GUI-based applications with Calibre nmSRAF.");
MGCAddSnippet(151, "You import the Calibre nmOPC session into the RET Flow Tool.");
MGCAddSnippet(152, "You extract the Calibre nmSRAF portions of your SVRF file, and import it into the RET Flow Tool. This session is added to the existing nmOPC session already in place.");
MGCAddSnippet(153, "You can set a variety of options within the RET Flow Tool for analysis.");
MGCAddSnippet(154, "You can display gradient maps superimposed on your layout using Calibre WORKbench.");
MGCAddSnippet(155, "You can draw cutlines and display resulting aerial intensity plots using Calibre WORKbench.");
MGCAddSnippet(156, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

